import { useState } from "react";
import api from "../api/globalApi";

function GenerateApp() {
  const [className, setClassName] = useState("");
  const [fields, setFields] = useState([
    { name: "", type: "String", primary: false },
  ]);
  const [responseMsg, setResponseMsg] = useState("");

  const handleFieldChange = (index: number, key: string, value: any) => {
    const updatedFields = [...fields];
    updatedFields[index][key] = value;
    setFields(updatedFields);
  };

  const addField = () => {
    setFields([...fields, { name: "", type: "String", primary: false }]);
  };

  const removeField = (index: number) => {
    const updatedFields = fields.filter((_, i) => i !== index);
    setFields(updatedFields);
  };

  const handleGenerate = async () => {
    try {
      const payload = {
        className,
        fields,
      };
      const response = await api.post("/generateApp", payload);
      setResponseMsg(response.data.message);
    } catch (err) {
      console.error("Error generating app:", err);
      setResponseMsg("Error generating app");
    }
  };

  return (
    <div>
      <h2>Generate Spring Boot App</h2>
      <input
        type="text"
        value={className}
        onChange={(e) => setClassName(e.target.value)}
        placeholder="Enter full class name"
        style={{ width: "100%", marginBottom: "10px" }}
      />

      <h3>Fields</h3>
      {fields.map((field, index) => (
        <div
          key={index}
          style={{ display: "flex", gap: "10px", marginBottom: "10px" }}
        >
          <input
            type="text"
            placeholder="Name"
            value={field.name}
            onChange={(e) => handleFieldChange(index, "name", e.target.value)}
          />
          <select
            value={field.type}
            onChange={(e) => handleFieldChange(index, "type", e.target.value)}
          >
            <option value="String">String</option>
            <option value="Long">Long</option>
            <option value="Integer">Integer</option>
            <option value="Double">Double</option>
            <option value="Boolean">Boolean</option>
            <option value="LocalDateTime">LocalDateTime</option>
            <option value="Date">Date</option>
          </select>
          <label>
            <input
              type="checkbox"
              checked={field.primary}
              onChange={(e) =>
                handleFieldChange(index, "primary", e.target.checked)
              }
            />
            Primary
          </label>
          <button onClick={() => removeField(index)}>Remove</button>
        </div>
      ))}

      <button onClick={addField}>Add Field</button>
      <br />
      <br />
      <button onClick={handleGenerate}>Generate</button>

      {responseMsg && <p>{responseMsg}</p>}
    </div>
  );
}

export default GenerateApp;
